import React from 'react';
import styles from './LayoutPost.module.scss';
import { Link } from 'react-router-dom';
import { Row, Col } from 'react-bootstrap';
const LayoutPost = () =>{
    return(
        <Row className={styles.container}>
            <Col xs={12} sm={12} md={4} lg={4} className={styles.images}>
                <img src={require('../../img/images/blog-1.jpeg').default} alt='Item1'/>
            </Col>
            <Col xs={12} sm={12} md={8} lg={8} className={styles.content}>
                <p><Link>Link</Link></p>
                <p>Content in here!</p>
            </Col>
        </Row>
    )
}

export default LayoutPost;
